import{_ as e,c as a,o as i,d as t}from"./app.6201899d.js";const f=JSON.parse('{"title":"\uC18C\uAC1C","description":"","frontmatter":{},"headers":[{"level":2,"title":"\uC65C REBS\uB97C \uC0AC\uC6A9\uD558\uB098\uC694?","slug":"\uC65C-rebs\uB97C-\uC0AC\uC6A9\uD558\uB098\uC694"},{"level":2,"title":"\uC8FC\uC694 \uAE30\uB2A5","slug":"\uC8FC\uC694-\uAE30\uB2A5"}],"relativePath":"index.md","lastUpdated":1660115081000}'),l={name:"index.md"},r=t('<h1 id="\uC18C\uAC1C" tabindex="-1">\uC18C\uAC1C <a class="header-anchor" href="#\uC18C\uAC1C" aria-hidden="true">#</a></h1><p>REBS\uB294 \uAC04\uB2E8\uD55C \uC785\uCD9C\uAE08, \uBB38\uC11C \uAD00\uB9AC\uB97C \uD3EC\uD568\uD55C \uBD80\uB3D9\uC0B0 \uAC1C\uBC1C(\uC2DC\uD589)\uAD00\uB9AC \uD504\uB85C\uADF8\uB7A8\uC785\uB2C8\uB2E4.</p><h2 id="\uC65C-rebs\uB97C-\uC0AC\uC6A9\uD558\uB098\uC694" tabindex="-1">\uC65C REBS\uB97C \uC0AC\uC6A9\uD558\uB098\uC694? <a class="header-anchor" href="#\uC65C-rebs\uB97C-\uC0AC\uC6A9\uD558\uB098\uC694" aria-hidden="true">#</a></h2><p>REBS\uB294 \uACF5\uB3D9\uC8FC\uD0DD, \uC8FC\uC0C1\uBCF5\uD569, \uC624\uD53C\uC2A4\uD154 \uC0C1\uAC00 \uB4F1 \uC5EC\uB7EC \uC720\uD615\uC758 \uBD80\uB3D9\uC0B0 \uAC1C\uBC1C \uC0C1\uD488\uC744 \uB2E4\uC591\uD55C \uD0C0\uC785 \uBC0F \uC635\uC158\uC5D0 \uB530\uB978 \uBCF5\uC7A1\uD55C \uC0C1\uD488\uC758 \uD615\uD0DC\uB97C \uBAA8\uB450 \uBC18\uC601\uD558\uC5EC \uAD00\uB9AC\uD558\uAE30\uB780 \uC27D\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.</p><p>\uB610\uD55C \uC77C\uBC18\uBD84\uC591, \uC870\uD569\uC6D0 \uBAA8\uC9D1 \uBC29\uC2DD \uB4F1 \uB2E4\uC591\uD55C \uD615\uD0DC\uC758 \uC0AC\uC5C5 \uBC29\uBC95\uC73C\uB85C \uC2DC\uD589\uC744 \uC9C4\uD589 \uD558\uAC8C \uB420 \uACBD\uC6B0 \uC0DD\uC0B0\uB418\uB294 \uB370\uC774\uD130 \uAD00\uB9AC\uC758 \uBCF5\uC7A1\uD568\uC740 \uB354\uC6B1 \uAC00\uC911\uB429\uB2C8\uB2E4.</p><p>\uBD80\uB3D9\uC0B0 \uAC1C\uBC1C\uC0AC\uC5C5\uC740 \uC774\uB7EC\uD55C \uB370\uC774\uD130\uB97C \uAD00\uB9AC\uD558\uAE30 \uC774\uC804\uC5D0 \uC774\uBBF8 \uC0C1\uD488 \uB514\uC790\uC778(\uAE30\uB2A5 \uBC0F \uC678\uAD00), \uC2DC\uC7A5\uC5D0\uC11C\uC758 \uC218\uC694\uC5D0 \uB300\uD55C \uC608\uCE21, \uC778\uD5C8\uAC00\uC640 \uAD00\uB828\uD55C \uAC01\uC885 \uBC95\uB960\uC801\uC778 \uC0AC\uD56D, \uD1A0\uC9C0 \uB9E4\uC785, \uB300\uADDC\uBAA8 \uC790\uAE08 \uC870\uB2EC \uB4F1 \uAE30\uD68D\uB2E8\uACC4\uBD80\uD130 \uC0AC\uC5C5\uC758 \uC131\uD328\uB97C \uC88C\uC6B0\uD560 \uB9CC\uD07C \uC9D1\uC911 \uD574\uC57C\uD560 \uC911\uC694\uD55C \uD56D\uBAA9\uB4E4\uC774 \uB9CE\uC2B5\uB2C8\uB2E4.</p><p>\uAC1C\uBC1C\uC0AC\uC5C5\uC744 \uC218\uD589\uD560 \uB54C\uC5D0 \uC774\uCC98\uB7FC \uB354\uC6B1 \uC911\uC694\uD55C \uC0AC\uD56D\uB4E4\uC5D0 \uC9D1\uC911\uD560 \uC218 \uC788\uB3C4\uB85D, REBS\uB294 \uAC1C\uBC1C\uC0AC\uC5C5\uC744 \uC9C4\uD589\uD558\uBA74\uC11C \uD544\uC5F0\uC801\uC73C\uB85C \uC0DD\uC0B0\uB418\uB294 \uB370\uC774\uD130\uB97C \uC815\uD655\uD558\uACE0 \uD3B8\uB9AC\uD558\uAC8C \uAD00\uB9AC\uD558\uACE0 \uC5F4\uB78C\uD560 \uC218 \uC788\uB3C4\uB85D \uC124\uACC4\uB418\uC5C8\uC2B5\uB2C8\uB2E4. \uB610\uD55C \uC774\uB7F0 \uBAA9\uC801\uC744 \uAD6C\uD604\uD558\uAE30 \uC704\uD574\uC11C \uACC4\uC18D \uADF8 \uAE30\uB2A5\uC744 \uAC1C\uC120\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4.</p><h2 id="\uC8FC\uC694-\uAE30\uB2A5" tabindex="-1">\uC8FC\uC694 \uAE30\uB2A5 <a class="header-anchor" href="#\uC8FC\uC694-\uAE30\uB2A5" aria-hidden="true">#</a></h2><ul><li>\uD504\uB85C\uC81D\uD2B8 \uC885\uB958 \uBC0F \uC131\uACA9\uC5D0 \uB530\uB978 \uC0C1\uC138 \uC124\uC815 \uC9C0\uC6D0</li><li>\uD310\uB9E4 \uC0C1\uD488 \uC720\uB2C8\uD2B8\uC640 \uACC4\uC57D \uACE0\uAC1D\uC758 1:1 \uB9E4\uCE6D \uB4F1\uB85D \uAD00\uB9AC</li><li>\uACC4\uC57D \uACE0\uAC1D \uC815\uBCF4 \uBC0F \uB300\uAE08 \uC218\uB0A9 \uAD00\uB9AC</li><li>\uACE0\uAC1D \uB0A9\uBD80 \uB300\uAE08 \uC218\uB0A9 \uAD00\uB9AC\uB9CC\uC73C\uB85C \uC0AC\uC5C5 \uC608\uC0B0\uACFC \uC5F0\uB3D9 \uAD00\uB9AC</li><li>\uC77C\uBC18 \uC785\uCD9C\uAE08 \uD68C\uACC4 \uAD00\uB9AC\uB85C \uACE0\uAC1D \uB300\uAE08 \uC218\uB0A9\uACFC \uC5F0\uB3D9 \uAD00\uB9AC</li><li>\uBCF8\uC0AC \uBC0F \uD604\uC7A5 \uBB38\uC11C \uAD00\uB9AC \uBC0F \uC18C\uC1A1 \uC0AC\uAC74 \uAD00\uB9AC</li><li>\uBCF8\uC0AC \uBC0F \uD604\uC7A5 \uC911\uC694 \uC77C\uC815 \uBC0F \uAD00\uB9AC\uC790 \uD560 \uC77C \uAD00\uB9AC \uAE30\uB2A5</li></ul><p>[\uB2E4\uC774\uC5B4\uADF8\uB7A8]</p><ul><li>\uD504\uB85C\uC81D\uD2B8 \uC124\uC815 -&gt; \uC720\uB2C8\uD2B8 \uB4F1\uB85D -&gt; \uC0C1\uD488 \uBD84\uC591 \uD0C0\uC785 \uBC0F \uC870\uAC74 \uB4F1\uB85D</li><li>\uACC4\uC57D \uBC0F \uACE0\uAC1D \uB4F1\uB85D -&gt; \uB300\uAE08 \uC218\uB0A9 \uAD00\uB9AC -&gt; \uC0AC\uC5C5 \uC608\uC0B0 \uAD00\uB9AC</li><li>\uC77C\uBC18 \uC785\uCD9C\uAE08 (\uBCF8\uC0AC \uBC0F \uD604\uC7A5 \uAD6C\uBD84 \uAD00\uB9AC) -&gt; \uD604\uC7A5 \uC785\uCD9C\uAE08 \uB4F1\uB85D \uC2DC -&gt; \uB300\uAE08 \uC218\uB0A9 \uC5F0\uB3D9 \uAD00\uB9AC</li></ul>',11),d=[r];function s(n,_,c,o,p,h){return i(),a("div",null,d)}var S=e(l,[["render",s]]);export{f as __pageData,S as default};
